(230, 'mc_templates', 'a:10:{s:5:\"title\";s:15:\"{time}: {title}\";s:10:\"title_list\";s:7:\"{title}\";s:10:\"title_solo\";s:7:\"{title}\";s:4:\"link\";s:20:\"Plus d\\\'informations\";s:4:\"grid\";s:448:\"<span class=\\\"event-time value-title\\\" title=\\\"{dtstart}\\\">{time}<span class=\\\"time-separator\\\"> - </span>{endtime before=\\\"<span class=\\\'end-time\\\' title=\\\'{dtend}\\\'>\\\" after=\\\"</span>\\\"}</span>\r\n\r\n		<div class=\\\"sub-details\\\">\r\n		{hcard}\r\n		{details before=\\\"<p class=\\\'mc_details\\\'>\\\" after=\\\"</p>\\\"}\r\n		<p><a href=\\\"{linking}\\\" class=\\\"event-link external\\\"><span class=\\\"screen-reader-text\\\">More information about </span>{title}</a></p></div>\";s:4:\"list\";s:504:\"<span class=\\\"event-time value-title\\\" title=\\\"{dtstart}\\\">{time}<span class=\\\"time-separator\\\"> - </span>{endtime before=\\\"<span class=\\\'end-time value-title\\\' title=\\\'{dtend}\\\'>\\\" after=\\\"</span>\\\"}</span>\r\n\r\n		<h3 class=\\\"event-title\\\">{title}</h3>\r\n\r\n		<div class=\\\"sub-details\\\">\r\n		{hcard}\r\n		{details before=\\\"<p class=\\\'mc_details\\\'>\\\" after=\\\"</p>\\\"}\r\n		<p><a href=\\\"{linking}\\\" class=\\\"event-link external\\\"><span class=\\\"screen-reader-text\\\">More information about </span>{title}</a></p></div>\";s:4:\"mini\";s:505:\"<span class=\\\"event-time value-title\\\" title=\\\"{dtstart}\\\">{time}<span class=\\\"time-separator\\\"> - </span>{endtime before=\\\"<span class=\\\'end-time value-title\\\' title=\\\'{dtend}\\\'>\\\" after=\\\"</span>\\\"}</span>\r\n\r\n		<h3 class=\\\"event-title\\\">{title}</h3>\r\n\r\n		<div class=\\\"sub-details\\\">\r\n		{excerpt before=\\\"<div class=\\\'excerpt\\\'>\\\" after=\\\"</div>\\\"}\r\n		{hcard}\r\n		<p><a href=\\\"{linking}\\\" class=\\\"event-link external\\\"><span class=\\\"screen-reader-text\\\">More information about </span>{title}</a></p></div>\";s:3:\"rss\";s:889:\"\n<item>\r\n			<title>{rss_title}: {date}, {time}</title>\r\n			<link>{link}</link>\r\n			<pubDate>{rssdate}</pubDate>\r\n			<dc:creator>{author}</dc:creator>\r\n			<description><![CDATA[{rss_description}]]></description>\r\n			<content:encoded><![CDATA[<div class=\\\'vevent\\\'>\r\n			<h1 class=\\\'summary\\\'>{rss_title}</h1>\r\n			<div class=\\\'description\\\'>{rss_description}</div>\r\n			<p class=\\\'dtstart\\\' title=\\\'{ical_start}\\\'>Begins: {time} on {date}</p>\r\n			<p class=\\\'dtend\\\' title=\\\'{ical_end}\\\'>Ends: {endtime} on {enddate}</p>\r\n			<p>Recurrence: {recurs}</p>\r\n			<p>Repetition: {repeats} times</p>\r\n			<div class=\\\'location\\\'>{rss_hcard}</div>\r\n			{link_title}\r\n			</div>]]></content:encoded>\r\n			<dc:format xmlns:dc=\\\'http://purl.org/dc/elements/1.1/\\\'>text/html</dc:format>\r\n			<dc:source xmlns:dc=\\\'http://purl.org/dc/elements/1.1/\\\'>http://localhost/la_globale</dc:source>\r\n			{guid}\r\n		</item>\r\n\";s:7:\"details\";s:483:\"<span class=\\\"event-time value-title\\\" title=\\\"{dtstart}\\\">{time}<span class=\\\"time-separator\\\"> - </span><span class=\\\"end-time value-title\\\" title=\\\"{dtend}\\\">{endtime}</span></span>\r\n\r\n		<div class=\\\"sub-details\\\">\r\n		{hcard}\r\n		<div class=\\\"mc-description\\\">{image}{description}</div>\r\n		<p>{ical_html} &bull; {gcal_link}</p>\r\n		{map}\r\n		<p><a href=\\\"{linking}\\\" class=\\\"event-link external\\\"><span class=\\\"screen-reader-text\\\">More information about </span>{title}</a></p></div>\";s:5:\"label\";s:9:\"Voir plus\";}', 'yes'),
